import React, { Component, Fragment } from 'react';
import { Wrapper } from './History.styled.js';

class History extends Component {
  constructor(props){
    super(props);
    this.state={};

  }


  render() {
    return (
      <Wrapper>
        <ul>
          <li>Goalie Coach Bulgarian National Team IIHF Division 2</li><span>(2017-Present)</span>
          <li>USA Hockey Goaltending Development Coordinator (Colorado) (2020)</li>
          <li>On Ice Director - Goalie Guild's Global Goaltending Retreat (2017-Present)</li>
          <li>Association Goalie Coach - Summit Hockey (2010-2020)</li>
          <li>Head Goaltending Instructor - Banff Hockey School (2008-2010)</li>
          <li>Goaltending Coach - Okanagan Hockey School (2006-2009)</li>
        </ul>
      </Wrapper>
    );
  }
}

export default History;
